import gold from '../gold.gif';
import Mind from './Mind';


const Body = () => {
  return (
    <div>
      <header className="App-header">
      <br /> <br />
      <img src={gold} className="banner" alt="logo" />
      </header>
      <Mind />
      <Contact />
    </div>
  );
}

export default Body;
